// Example in Home.js
import React from 'react';
import { Link } from 'react-router-dom';

function App() {
  return (
    <div>
      <h2>Home</h2>
      <Link to="/Components/ViewContacts">About</Link>
      <Link to="/Components/EditContact">About</Link>
      <Link to="/Components/SearchContact">About</Link>
      <Link to="/Components/AddContact">About</Link>
      <Link to="/">Contact</Link>
    </div>
  );
}

export default App;
